window.bookSummaryJSON = "<p><b><i>Amplitude </i></b><b>completes the Dimension Space Trilogy.</b></p> <p>Angela’s reset bought us a new chance, but with the event set to repeat itself, can she and Vaughn save their comrades? In Houston, Director Randal McCree races against the clock as he frantically struggles to save a scrabbled-together team. The survivors will have to join forces if Angela is to enact her plan to take the battle to the enemy.&nbsp;</p> <p>Once united, can the survivors make the enemy pay for what it did to all of Earth’s life? If you enjoyed&nbsp;<i>Solitude </i>and <i>Multitude</i>,&nbsp;you'll love the action and plot twists in this apocalyptic epic.</p> <p><b>Finish the first Dimension Space Trilogy! Scroll up and buy the audiobook today!</b></p> <p><b>What your favorite authors are saying about </b><b><i>Dimension Space</i></b><b>:</b></p> <p>\"Like <i>The Martian </i>on (and above) Earth. An epic survival story with very human characters, clever problem-solving and a gripping mystery. The end left me with no idea where Dean was going with the story, I couldn’t wait for the next book.” (Craig Alanson, <i>The New York Times</i> best-selling author of the Expeditionary Force Series)</p> <p>\"His vibrant prose delivers the high-resolution imagery of a Hollywood blockbuster.\" (<i>Kirkus Reviews</i>)</p>"; 
